import React from 'react';
import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';

function App() {
  return (
    <MDBContainer fluid>
      <div
        className='d-flex justify-content-center align-items-center'
        style={{ height: '100vh' }}
      >
      <div className='centered'>
        <MDBCardBody>
          <MDBCardTitle>
            Card Title
          </MDBCardTitle>
          <MDBCardText>
            recipe description
          </MDBCardText>
          <MDBBtn>
            Button
          </MDBBtn>
        </MDBCardBody>

      </div>
      </div>
    </MDBContainer>
  );
}

export default App;
